import React from 'react';
import logo from './pages/images/logo.png';
import { Layout, Menu, Typography } from 'antd';

const { Header } = Layout;
const { Text } = Typography;

function NavTabs({ currentPage, handlePageChange }) {
  return (
    <Header
      style={{
        position: 'sticky',
        top: 0,
        zIndex: 1,
        width: '100%',
        display: 'flex',
        alignItems: 'center',
        background: 'red', // Set the background color to red
        color: 'white', // Set the text color to white
      }}
    >
      <div className="logo">
        <img src={logo} alt="Travel Bug Logo" style={{ width: '200px', height: '50px' }} />
      </div>
      <Menu
        theme="dark"
        mode="horizontal"
        defaultSelectedKeys={['Home']}
        selectedKeys={[currentPage]}
        onClick={({ key }) => handlePageChange(key)}
      >
        <Menu.ItemGroup title="Navigation">
          <Menu.Item key="Home">
            <Text level={5}>Home</Text>
          </Menu.Item>
          <Menu.Item key="Attractions">
            <Text level={5}>Attractions</Text>
          </Menu.Item>
          <Menu.Item key="PlacesToGo">
            <Text level={5}>Places to Visit</Text>
          </Menu.Item>
          <Menu.Item key="Restaurants">
            <Text level={5}>Restaurants</Text>
          </Menu.Item>
        </Menu.ItemGroup>
      </Menu>
    </Header>
  );
}

export default NavTabs;
